import fs from 'fs';
import path from 'path';

const sourcePath = path.resolve(__dirname, '../.env.local'); // Adjust path as needed
const targetPath = path.resolve(__dirname, '.env');

fs.copyFile(sourcePath, targetPath, (err) =>
{
    if (err) throw err;
    console.log('`.env` file copied to project root');
});


const ENV = process.env;
export default  ENV
